import React from 'react';

function Pricing() {
    return ( 
       <div className='container'>
        <div className='row'>
            <div className='col-4'>
                <h1 className='mb-3'>Unbeatable Pricing</h1>
                <p></p>
            </div>
            <div className='col-2'></div>
            <div className='col-6'></div>
        </div>
       </div>
     );
}

export default Pricing;
